import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import AcademicProjects from './components/AcademicProjects';
import CaseStudies from './components/CaseStudies';
import ProductTeardowns from './components/ProductTeardowns';
import PRDs from './components/PRD';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/academic-projects" component={AcademicProjects} />
        <Route path="/case-studies" component={CaseStudies} />
        <Route path="/product-teardowns" component={ProductTeardowns} />
        <Route path="/prds" component={PRD} />
      </Switch>
    </Router>
  );
}

export default App;
